import axios from "axios";

const TestAxios = () => {
    const res = useState(null);
    useEffect(() => {
        const fetchData = async () => {
            res = await axios.post("http://127.0.0.1:8000/auth/jwt/create/", {
                email: "moustafashahin122@gmail.com",
                password: "lovelove122@A",
            }
            );

};
fetchData();
    }, []);



return (


    <p>
        {res.data}
    </p>

);
};

export default TestAxios;
